import React, { Component } from "react";

class Assigment extends Component {
  constructor(props) {
    super(props);
    this.state = { classInfo: this.props.location.state };
  }
  render() {
    console.log(this.props.location.state);
    return <div></div>;
  }
}

export default Assigment;
